import React, { useEffect, useState } from "react";

const GlobalQueue = () => {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    // Using the dummy data from mars-api.json instead of API call
    const dummyData = {
      "mars": {
        "jobQueue": {
          "globalQueue": [
            {
              "jobId": 201,
              "employerId": "E001",
              "jobTitle": "Java Developer",
              "location": "New York",
              "salaryRange": "$70k-$90k",
              "visaType": "H1B",
              "jobType": "FULL_TIME",
              "jobStatus": "OPEN",
              "createdAt": "2025-09-01T09:00:00Z"
            },
            {
              "jobId": 202,
              "employerId": "E002",
              "jobTitle": "UI/UX Designer",
              "location": "San Francisco",
              "salaryRange": "$60k-$80k",
              "visaType": "OPT",
              "jobType": "CONTRACT",
              "jobStatus": "IN_PROGRESS",
              "createdAt": "2025-09-03T10:30:00Z"
            }
          ]
        }
      }
    };

    // Set the global queue data
    setJobs(dummyData.mars.jobQueue.globalQueue);
  }, []);

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString();
  };

  const getStatusStyle = (status) => {
    switch (status) {
      case "OPEN":
        return { color: "green", fontWeight: "bold" };
      case "IN_PROGRESS":
        return { color: "blue", fontWeight: "bold" };
      case "CLOSED":
        return { color: "gray", fontWeight: "bold" };
      default:
        return { color: "black" };
    }
  };

  return (
    <div>
      <h3>Global Queue</h3>
      <div style={{ marginBottom: "20px", color: "#666" }}>
        Showing {jobs.length} jobs in global queue
      </div>
      <table>
        <thead>
          <tr>
            <th>Job ID</th>
            <th>Employer ID</th>
            <th>Job Title</th>
            <th>Location</th>
            <th>Salary Range</th>
            <th>Visa Type</th>
            <th>Job Type</th>
            <th>Status</th>
            <th>Created At</th>
          </tr>
        </thead>
        <tbody>
          {jobs.length > 0 ? (
            jobs.map((job, idx) => (
              <tr key={idx}>
                <td>{job.jobId}</td>
                <td>{job.employerId}</td>
                <td>{job.jobTitle}</td>
                <td>{job.location}</td>
                <td>{job.salaryRange}</td>
                <td>{job.visaType}</td>
                <td>{job.jobType}</td>
                <td style={getStatusStyle(job.jobStatus)}>{job.jobStatus}</td>
                <td>{formatDate(job.createdAt)}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="9" style={{ textAlign: "center", color: "#666" }}>
                No jobs available in global queue
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default GlobalQueue;
